import React, { useState } from 'react';
import { faUsers, faWordpress } from '@fortawesome/free-solid-svg-icons';
import { FontAwesomeIcon } from '@fortawesome/react-fontawesome';

function SidebarComponent() {

    // states
    const [ current, setCurrent] =useState('all-users')

    // return
    return (
        <div className="w-72 h-screen fixed border border-black p-3 mt-16">
            <div className="w-full h-screen bg-gray-200 rounded-lg px-9 py-5">
                <div className="flex flex-row w-full hover:bg-gray-300 rounded-md mt-4 p-2">
                    <FontAwesomeIcon className='mt-1' icon={faUsers} color='black' size="md" />
                    <h1 className="text-md font-semibold text-black ml-2">All users</h1>
                </div>
                <div className="flex flex-row w-full hover:bg-gray-300 rounded-md mt-4 p-2">
                    <FontAwesomeIcon className='mt-1' icon={faBlogger} color='black' size="md" />
                    <h1 className="text-md font-semibold text-black ml-2">All Posts</h1>
                </div>
            </div>
        </div>
    );
}

export default SidebarComponent;
